story_json = None

st.title("Dream Weaver - an AI bedtime story generator")
col1, col2, col3, col4, col5 = st.columns((1,1,1,1,1))

audience = col1.text_area(label="Who is this bedtime story for", max_chars=500, height=300, placeholder=default_audience)
